    [],nt"revision_timestamp": "2016-07-27T22:19:42.288522",nt"name": "effects-of-flood-control-alternatives-on-the-hydrology-vegetation-and-wildlife-resources-o",nt"isopen":
    false,nt"url": null,nt"notes": "The facilitated modeling workshops described
    in this report were conducted  January 14-18, November 13-14, and December 17, 1985,
    under the joint sponsorship  of the Portland Ecological Services Field Office and
    the Malheur National  Wildlife Refuge, Region 1, U.S. Fish and Wildlife Service
    (FWS). The Portland  Field Office is responsible for FWS comments on the impacts
    of Federal water  resource projects while the Refuge staff has management responsibility
    for  much of the land affected by high water levels in the Malheur-Harney Lakes
     Basin. The primary objective of the first workshop was to begin gathering and
     analyzing information concerning potential fish and wildlife impacts, needs,  and
    opportunities associated with proposed U.S. Army Corps of Engineers (COE) flood
    control alternatives for Malheur Lake. The workshop was structured  around the formulation
    of a computer model that would simulate the hydrologic  effects of the various alternatives
    and any concomitant changes in vegetation  in communities and wildlife use patterns.
    The objectives of the subsequent workshops were to refine the simulation model and
    use it to analyze the flood  control alternatives addressed in the CDE Feasibility
    Study.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
